import React from "react";
import ExpandableSection from "./ExpandableSection";

export const EquipmentList = ({ equipments }) => {
  return (
    <div className="List-Destop">
      {/* Passez une prop "id" unique à chaque ExpandableSection */}
      <ExpandableSection id="equipments" title="Équipements">
        {/* Utilisez la méthode "join" pour concaténer tous les équipements dans une seule chaîne */}
        <p>{equipments.join(', ')}</p>
      </ExpandableSection>
    </div>
  );
};
